snippet.description:
いくわよ
#ゲリラ宇宙人狼

【ルール説明】

やるゲーム→Among Us
宇宙船を舞台にミッション(タスク)をクリアしながら宇宙船を出向させるというのが目的。
ただし、この宇宙船には裏切り者が2人紛れている。

■船員側勝利
・ミッションをすべて成功させる
・人狼を全員追放する

■人狼側勝利
・船員と同人数になったとき
・船員がミッションをこなせなかった時

普段の動きでお互いの声が聞こえないが、死体を見つけたり、おかしなことばあれば、緊急招集してボイスオンの話し合いをすることができる。
あと今回は、「公に死が確定した」人専用の墓場ボイスチャットがあります！

メンバー
@竜胆 尊 / Rindou Mikoto
@月ノ美兎
@早瀬 走 / Hayase Sou【にじさんじ所属】
@本間ひまわり - Himawari Honma -
@夜見れな/yorumi rena【にじさんじ所属 
@不破 湊 / Fuwa Minato【にじさんじ】
@三枝明那 / Saegusa Akina
@黛 灰 / Kai Mayuzumi【にじさんじ】
@でびでび・でびる
@甲斐田 晴 / Kaida Haru【にじさんじ】

